import React, {useEffect, useState} from 'react';
import './App.css';
// import { Questions } from "./components/questions";

function App() {
  const [question, setQuestion] = useState("");
  const [questioner, setQuestioner] = useState("");
  const [currentQuestion, setCurrentQuestion] = useState("");
  const [currentQuestioner, setCurrentQuestioner] = useState("");

  useEffect(() => {
    fetch("http://localhost:5000/?question=4&id=1X6qxNWpj31C3wFc-T_8yeLlsZKsUYimvHtKaG6hJ8QU").then(response =>
      response.json().then(data => {
        console.log(data);
        setQuestioner(data.values[0][0]);
        setQuestion(data.values[0][1]);
      })
    );
  }, [])

  return (
    <div className="App">
      <button className='yeet' onClick={function() { alert('click'); setQuestion("dad"); }}>
        Answer
      </button>
      <button className='yeet' onClick={function() { alert('click'); setQuestion("dad"); }}>
        Skip
      </button>
      <p>{questioner}</p>
      <p>{question}</p>
      <form>
        <label>
          Name:
         <input type="text" name="name" />
        </label>
        <input type="submit" value="Submit" />
     </form>
    </div>
  );
}

export default App;
